using ACME.Models;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Numerics;
using System.Threading.Tasks;

namespace ACME.Helpers
{
    public class DummyData
    {
        public static Product CreateProduct()
        {
            Product product = new Product
            {
                Name = "Stank Face",
                Active = true,
                Description = "Stank face like Stevie Ray Vaughan",
                Image = StringToByteArray(""),
                Price = 250
            };

            return product;
        }

        public static List<Category> CreateCategories()
        {
            var categories = new List<string> {
                "Automotive & DIY",
                "Baby & Toddler",
                "Beauty",
                "Books & Courses",
                "Camping & Outdoor",
                "Cellphones & Wearables",
                "Fashion & Luggage",
                "Computers & Electronics",
                "Gaming",
                "Garden, Pool & Patio",
                "Groceries & Household",
                "Health & Hygiene",
                "Home & Appliances",
                "Liquor",
                "Office & Stationery",
                "Pets",
                "Sports & Training",
                "Toys",
                "TV, Audio & Media"
            };
            var categoryObjects = new List<Category>();
            categories.ForEach(category => { 
                categoryObjects.Add(new Category { Name = category }); 
            });

            return categoryObjects;
        }

        public static byte[] StringToByteArray(string hex)
        {
            return BigInteger.Parse(hex, System.Globalization.NumberStyles.HexNumber).ToByteArray().Reverse().ToArray();
        }
    }
}
